import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';


function App() {

  const [message, setMessage] = useState('')

  async function getFromServer() {
    const response = await fetch('/api/messages')
    const data = await response.json()
    setMessage(data)
  }

  useEffect(() => {
    getFromServer()
  }, [])


  return (
    <div className="App">
      <h1>React App</h1>
      {}
    </div>
  );
}

export default App;
